import './ShowResults.css';

const ShowResults = (props) => {
	return (
		<div>
			console.log(props.distance})
			<h1>Łączny koszt wynajmu: {parseInt(props.distance) * props.fuel_cost }</h1>
			<ul>
				<li>Koszt paliwa: {parseInt(props.distance) * props.fuel_cost} </li>
				<li>Koszt spowodowany czasem posiadania prawa jazdy: {parseInt(props.distance) * props.fuel_cost} </li>
				<li>Koszt marką samochodu: {parseInt(props.distance) * props.fuel_cost} </li>
				<li>Koszt liczbą modeli samochodu: {parseInt(props.distance) * props.fuel_cost} </li>
				<li>Koszt netto: {parseInt(props.distance) * props.fuel_cost} </li>
				<li>Koszt brutto: {parseInt(props.distance) * props.fuel_cost} </li>
			</ul>
			<button onClick={props.Change}>Wróć</button>
		</div>
	);
};

export default ShowResults;
